import"./modulepreload-polyfill.c7c6310f.js";window.addEventListener("load",async()=>{try{const n=await(await fetch("https://picsum.photos/v2/list?limit=100")).json(),e=Math.floor(Math.random()*100),t=n[e],a=document.createElement("figure");a.innerHTML=`<img src="${t.download_url}" alt="${t.author}"><figcaption><p>Author: ${t.author}</p><p>ID: ${t.id}</p></figcaption>`,document.body.append(a)}catch(o){console.error(o)}});
